import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './Componenets/login/login.component';
import { RegisterComponent } from './Componenets/register/register.component';
import { RouterModule, Routes } from '@angular/router';
import { AdminComponent } from './Componenets/admin/admin.component';
import { FirstpageappComponent } from './Componenets/firstpageapp/firstpageapp.component';
import { FirstComponent } from './first/first.component';
import { NavComponent } from './Componenets/nav/nav.component';


const AppRoute: Routes =[
  {path:'',component:FirstpageappComponent},
  {path:'register',component:RegisterComponent},
  {path:'Admin',component:AdminComponent},
  {path:'login',component:LoginComponent}
]

@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    RegisterComponent,
    AdminComponent,
    FirstComponent,
    NavComponent

  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
